import os
current_dir = os.path.dirname(os.path.realpath(__file__))
os.chdir(current_dir)

from tokenizer import KMerTokenizer

with open('../parquet files/extra.txt', 'r', encoding='utf-8') as f:
  data = f.read()
  print("file opened!")

tokenizer = KMerTokenizer()
seq = """




"""

tokenizer.train_tokenizer(data, max_vocab=800)
tokenizer.save_model('trained models')

with open('../parquet files/train.txt', 'r', encoding='utf-8') as f:
  test_data = f.read()
  print("file opened!")

encoded_tokens = tokenizer.encode(seq)
decoded_tokens = tokenizer.decode(encoded_tokens)
# print(encoded_tokens)
# print(decoded_tokens)

print(f"seq length: {len(seq)} \ntokens length: {len(decoded_tokens)}")
print(seq == decoded_tokens)
print(f"file length: {len(seq)} \ntokens: {len(encoded_tokens)}")
print(f"compression ration: {(len(seq) / len(encoded_tokens)):.2f}x")